import React, {Component} from 'react';
import {
  StyleSheet, 
  SectionList,
  Text,
  View
} from 'react-native';

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      turnOn: true,
      turnOff: false
    }
  }
  render() {
    return (
      <View style = {styles.container}>
        <View style={styles.title_view}>
          <Text style={styles.title_text}>
          SectionList
          </Text>
        </View>
        <View style={styles.list}>
          <SectionList
            sections = {[
              {título: 'A', datos: ['   ', '   ']},
                             {título: 'B', datos: [' ', ' ', '   ']},
                             {título: 'C', datos: [' ', ' ', 'chen']},
                             {título: 'D', datos: ['Tío', 'Dongzi']},
              {title:'E',data:['EDIFIER']}
            ]}
            renderItem={({item}) =>
              <Text style={styles.item}>{item}</Text>
            }
            renderSectionHeader = {({section})=>
              <Text style={styles.sectionHeader}>{section.title}</Text>
            }
            keyExtractor = {(item,index) => index}
          />
        </View>
      </View> 
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F5FCFF',
  },
  title_view:{
    flexDirection:'row',
    height:50,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor:'#27b5ee',
  },
  title_text: {
    fontSize:20,
    color:'white'
  },
  sectionHeader: {
    paddingTop: 2,
    paddingLeft: 10,
    paddingRight: 10,
    paddingBottom: 2,
    fontSize: 14,
    fontWeight: 'bold',
    backgroundColor: 'rgba(247,247,247,1.0)',
  },
  item: {
    padding: 10,
    fontSize: 18,
    height: 44,
  },
});
